&lt;p&gt;Originally born in England of British parents (yes he&apos;s not a Natural Born Citizen), Gary Wilmott grew up in Canada and California. He attended UCLA, worked in corporate computer operations for a number of years before pursuing photography; graduating from Brooks Institute with a BA in commercial photography in 1985. Wilmott also owned and operated a very successful sports collectibles business for 10 years before deciding to pursue a career in law in 1998. Gary received his JD in 2002 and currently works for a firm in Los Angeles. &lt;/p&gt;

&lt;p&gt;Wilmott has been following the eligibility issue since the 2008 campaign and started his highly successful blog: giveusliberty1776.blogspot.com in June of 2009. A frequent caller and guest of talk radio; he has earned a reputation as a passionate and vocal proponent of the Constitution and a firm believer that Barack Obama’s illegal power grab threatens the security and freedom of all Americans.&lt;/p&gt;

&lt;p&gt;A founding member of the Article II Super Pac and the Article II Legal Defense Fund, Wilmott has devoted virtually all of his spare time to the eligibility issue.&lt;/p&gt;

&lt;p&gt;Wilmott believes that the Article 2 Super PAC&apos;s goal in educating citizens and elected officials so that they clearly understand the definitive meaning of &quot;Natural Born Citizen&quot; is essential to the development of a legally-binding vetting process that will avoid future election fraud as it relates to the &quot;selection/election&quot; of our future presidents/commander-in-chiefs. Wilmott and Article 2 Super PAC welcome the opportunity to reach out to listeners on America’s Web Radio and spread the message of our Founding Fathers: freedom, liberty and the pursuit of happiness for all.&lt;/p&gt;

